  false,\n\t\"url\": null,\n\t\"notes\": \"In order to protect the privacy of crime
  victims, addresses are generalized to the block level only and specific locations
  are not identified.rnrnDue to several factors (offense reclassification, reported
  versus occurred dates, etc.) comparisons should not be made between numbers generated
  with this database to any other official police reports. Data provided represents
  only calls for police service where a report was written. rnrnTotals in the database
  may vary considerably from official totals following investigation and final categorization.
  Therefore, the data should not be used for comparisons with Uniform Crime Report
  statistics. rnrnThe Austin Police Department does not assume any liability for any
  decision made or action taken or not taken by the recipient in reliance upon any
  information or data provided.rnrnThis Racial Profiling dataset (citations) provides
  the raw data needed to identify trends in traffic stops. It is used to help identify
  potential improvements in department policy, tactics, and training.trntrntrnCorresponding
  report:trnThis data is used to produce the annual Racial Profiling report, posted
  on APD's website here:trnhttp://www.austintexas.gov/page/racial-profiling-reports\",\n\t\"license_title\":
